import avatar1 from 'assets/avatars/avatar1.png';
import avatar2 from 'assets/avatars/avatar2.png';

export const kanbanPeople = {
  anna: {
    id: 'Alex',
    name: 'Alex',
    avatar: avatar1,
  },
  pavel: {
    id: 'Pavel',
    name: 'Pavel',
    avatar: avatar2,
  },
};
